import React from 'react';

import {
  HeaderContainer, InfoContainer
} from './HeaderStyles';

const Header = () => (
  <HeaderContainer>
    <h1>What, son?</h1>
    <InfoContainer>
      <img src="./images/info.svg" alt="information"/>
    </InfoContainer>
  </HeaderContainer>
)

export default Header;
